import React from 'react';
import './ProfileCard.css';

const ProfileCard = ({
  avatarUrl = '/images/avatar.png',
  name = 'DJ Suru',
  title = 'Professional DJ & Music Producer',
  handle = 'djsuru',
  status = 'Available for bookings',
  contactText = 'Learn More About Me',
  onContactClick
}) => {
  return (
    <div className="profile-card">
      <div className="profile-card-header">
        <img
          src={avatarUrl}
          alt={`${name} avatar`}
          className="profile-avatar"
        />
      </div>

      <div className="profile-card-content">
        <h3 className="profile-name">{name}</h3>
        <p className="profile-title">{title}</p>

        <div className="profile-info">
          <div className="profile-handle">@{handle}</div>
          <div className="profile-status">{status}</div>
        </div>

        <button
          className="profile-contact-btn"
          onClick={onContactClick}
        >
          {contactText}
        </button>
      </div>
    </div>
  );
};

export default ProfileCard;
